// 2. Vérification des données (pour debug)
console.log('Nombre de lots:', lots.length);
console.log('Premier lot:', lots[0]);

// 3. Groupement par sale_status et sell_type
const statusSellTypeGroups = lots.reduce((acc, lot) => {
    // Vérification que les champs nécessaires existent
    if (!lot.sale_status || !lot.sell_type) {
        console.warn('Lot incomplet:', lot.id);
        return acc;
    }

    const key = `${lot.sale_status}-${lot.sell_type}`;

    if (!acc[key]) {
        acc[key] = {
            sale_status: lot.sale_status,
            sell_type: lot.sell_type,
            count: 0,
            total_ht: 0,
            total_ttc: 0,
            total_tva: 0,
            total_surface: 0,
            formatted: {
                total_ht: '',
                total_ttc: '',
                total_tva: '',
                prix_m2: ''
            }
        };
    }

    // Conversion en Number pour éviter les erreurs
    acc[key].count += 1;
    acc[key].total_ht += Number(lot.price_ht) || 0;
    acc[key].total_ttc += Number(lot.price_ttc) || 0;
    acc[key].total_tva += (Number(lot.price_ttc) || 0) - (Number(lot.price_ht) || 0);
    acc[key].total_surface += Number(lot.surface) || 0;

    return acc;
}, {});

// 4. Conversion en tableau et formatage
const result = Object.values(statusSellTypeGroups).map(group => {
    // Calcul du prix au m² (protégé contre la division par 0)
    const prixM2 = group.total_surface > 0
        ? group.total_ttc / group.total_surface
        : 0;

    // Formatage des valeurs SANS décimales
    return {
        ...group,
        formatted: {
            total_ht: new Intl.NumberFormat('fr-FR', {
                style: 'currency',
                currency: 'EUR',
                minimumFractionDigits: 0,
                maximumFractionDigits: 0
            }).format(Math.round(group.total_ht)),
            total_ttc: new Intl.NumberFormat('fr-FR', {
                style: 'currency',
                currency: 'EUR',
                minimumFractionDigits: 0,
                maximumFractionDigits: 0
            }).format(Math.round(group.total_ttc)),
            total_tva: new Intl.NumberFormat('fr-FR', {
                style: 'currency',
                currency: 'EUR',
                minimumFractionDigits: 0,
                maximumFractionDigits: 0
            }).format(Math.round(group.total_tva)),
            total_surface: `${group.total_surface.toLocaleString('fr-FR')} m²`,
            prix_m2: new Intl.NumberFormat('fr-FR', {
                style: 'currency',
                currency: 'EUR',
                minimumFractionDigits: 0,
                maximumFractionDigits: 0
            }).format(Math.round(prixM2))
        }
    };
});

// 5. Tri des résultats
result.sort((a, b) => {
    const statusCompare = (a.sale_status || '').localeCompare(b.sale_status || '');
    return statusCompare !== 0 ? statusCompare : (a.sell_type || '').localeCompare(b.sell_type || '');
});

// 6. Retour du résultat avec vérification finale
console.log('Résultat formaté sans décimales:', result);
return result;

